#!/usr/bin/python3

import itertools
import os
import sys
import unittest

sys.path.append('..')
import plato_pylib.plato.parse_matrices_out_files as tCode

class testGetOnSiteTerms(unittest.TestCase):
	def setUp(self):
		self.fileDict = dict()
		self.fileDict["tb1HamA".lower()] = createTb1HamFileA() 
		self.fileDict["tb2HamA".lower()] = createTb2HamFileA()
	def tearDown(self):
#		for filePath in self.fileDict.values():
#			os.remove(filePath)
		pass

	def testGetOnSiteDiagTb1(self):
		expectedVals = [ [-1.971996, 2.763977, 2.75134, 2.75134, 9.033952, 9.025202, 9.025202, 9.002822, 9.002822],  #atom 1
		                 [-1.971996, 2.763977, 2.75134, 2.75134, 9.033952, 9.025202, 9.025202, 9.002822, 9.002822] ] #atom 2
		actualVals = tCode.getOnSiteDiagHamilTermsFromHamFile( self.fileDict["tb1HamA".lower()] )

		self.assertEqual( len(expectedVals), len(actualVals) )
		for expList,actList in itertools.zip_longest(expectedVals,actualVals):
			[self.assertAlmostEqual(exp,act) for exp,act in itertools.zip_longest(expList,actList)]

	def testGetOnSiteDiagTb2(self):
		expectedVals = [ [-1.964356, 2.767628, 2.767831, 2.767831, 9.036224, 9.035971, 9.035965, 9.03646, 9.036462],  #atom 1
		                 [-1.967091, 2.767642, 2.767846, 2.767845, 9.036224, 9.035971, 9.035965, 9.03646, 9.036462] ] #atom 2
		actualVals = tCode.getOnSiteDiagHamilTermsFromHamFile( self.fileDict["tb2HamA".lower()] )

		self.assertEqual( len(expectedVals), len(actualVals) )
		for expList,actList in itertools.zip_longest(expectedVals,actualVals):
			[self.assertAlmostEqual(exp,act) for exp,act in itertools.zip_longest(expList,actList)]



